 import React, {Component} from 'react'

 class Toolbar extends Component{
    render (){
        return(
            <header>
            <nav>
                <div></div>
                <div><a href="/">MAKEUP TRACEBOX</a></div>
                <div>
                    <ul>
                        <li><a href="/">Setting</a></li>
                        <li><a href="/">Logout</a></li>
                    </ul>
                </div>
            </nav>
        </header>
        )
    }
} 

 export default Toolbar
